Set and ready for tomorrow! Excited to be doing @fargojunkmarket for the first time this year. The venue is huge and spacious for shopping. Vendors have been setting up some gorgeous booths full of treasures. Be sure to get here tomorrow from 9 am - 4 pm at the Red River Valley Fairgrounds Butler Pavilion.
{General Admission $5 | Kids 12 and Under FREE}

Come hunt for some gems!

